g2:c.PROCEDURE.g2:a.TEXT:
_gqsvsup-startup (Object: class gfr-startup-object, InitialStartup: truth-value, Modules: class symbol-list, Client: class object)
 
  devstuffName: symbol = the symbol gdev-internals-workspaces; 
  intstuffName: symbol = the symbol int-internals-workspaces;
  Err: class error;

begin

  {--- No startup required for module restart }
  if not(InitialStartup) then return;

  {--- For devstuff development environment } 
  if the item S named by devstuffName exists and _gqsvsup-internals is not a member of S then
    insert _gqsvsup-internals at the end of the item-list named by devstuffName;
  if the item S named by intstuffName exists and _gqsvsup-internals is not a member of S then
    insert _gqsvsup-internals at the end of the item-list named by intstuffName;

end on error (Err)
  call gerr-dispatch (Err, this procedure, gfr-default-window);
end

find-next-item(X-POS: integer, ITMS: sequence) = (item-or-value)
NextItm: class item;
Next-X-POS: integer;
begin
    
    for NextItm = each item in ITMS do
        Next-X-POS = the item-x-position of NextItm;
        if (X-POS < Next-X-POS) then 
            return NextItm;
    end;
    return the symbol END;
end

get-button-attribute-name(Button : class item) = (sequence)
cdg-filter: symbol = the symbol cdg-target-or-sender-filter;
cdg-loaded: truth-value = false;
begin
 cdg-loaded = _opcs-check-for-cdg ();
 if Button is an sc-target-filter then 
    return sequence (the symbol smh-target)
 else if Button is an sc-sender-filter then 
    return sequence (the symbol smh-sender)
 else if cdg-loaded and Button is an instance of the class named by (cdg-filter) then
    return sequence (the symbol smh-target, the symbol smh-sender)
 else if Button is a sc-class-filter or Button is a sc-containment-filter then return sequence (the symbol smh-target)
 else 
    return sequence(the symbol none)
end

get-background-color-for-priority(Priority: integer) = (symbol)

color: symbol = OPFOM-DEFAULT-PRIORITY-COLOR;
begin
{inform the operator that "length is [the array-length of OPFOM-PRIORITY-ALARM-COLORS]";}
{inform the operator that "1: default color is [color]";}
   if Priority <= the array-length  of  OPFOM-PRIORITY-ALARM-COLORS   and
     Priority > 0
   then color =  OPFOM-PRIORITY-ALARM-COLORS[Priority - 1];
{inform the operator that "2: color is [color]";}
  return color;
end

get-definition-with-icon-description(ClassName: symbol) = (class object-definition)
Class: symbol;
Definition: class object-definition;
begin
  Definition = the object-definition named by ClassName;
  if the icon-description of Definition exists then 
    return Definition 
  else begin
    for Class = each symbol in the direct-superior-classes of Definition do 
       Definition = call get-definition-with-icon-description(Class);
       if the icon-description of Definition exists then
            return Definition;
    end;
end;
end

create-toolbar-description(Toolbar : class gxl-toolbar, Buttons: sequence) = (structure)
Description: structure;
begin
    Description = structure(TOOLBAR: Toolbar, BUTTONS: Buttons);
    return Description;
end

create-button-description(Button : class item) = (structure)
Description: structure;
Definition : class object-definition;
Color: symbol;
AttributeNames: sequence;
GroupName : symbol;
PrettyAttributeNames: text;
begin
Definition = call get-definition-with-icon-description(the class of Button);
if Button is an sc-toggle-button then begin 
    GroupName = call get-button-group-name(Button);
    Description = structure(GROUP: GroupName, CLASS-NAME: the class of Button,{ ICON-DESCRIPTION: the icon-description of Definition,}REPRESENTATION: the symbol CHECK-BOX, INITIAL-STATE: the sc-active of Button, ON-COLOR-OVERRIDES: structure (checked-color: the symbol black, face-color: the face-color icon-color of Button), OFF-COLOR-OVERRIDES: structure(face-color: the face-color icon-color of Button));
    if Button is an sc-smh-subscriber then begin
        Description = change-attribute (Description, SERVER, the sc-publisher of Button); 
        Description = change-attribute (Description, LABEL, "[the sc-publisher of Button]"); end;
    if Button is an sc-schematic-object-filter then begin
        AttributeNames = call get-button-attribute-name(Button);
        PrettyAttributeNames = call get-pretty-button-attribute-names(Button);
        Description = change-attribute(Description, ATTRIBUTE-NAMES, AttributeNames);
        Description = change-attribute(Description, ATTRIBUTE-VALUES, sequence (upper-case-text (the sc-filter-object of Button))); 
        Description = change-attribute(Description, LABEL, "[PrettyAttributeNames] = [the sc-filter-object of Button]"); 
        if Button is a sc-class-filter then Description = change-attribute (Description, SUBCLASS, "CLASS-FILTER")
        else if Button is a sc-containment-filter then Description = change-attribute (Description, SUBCLASS, "CONTAINMENT-FILTER")
        else Description = change-attribute (Description, SUBCLASS, "OTHER-OBJECT-FILTER")
     end;
     if Button is an sc-priority-filter then begin
        Description = change-attribute(Description, ATTRIBUTE-NAMES, sequence (the sc-attribute-name of Button));
        Description = change-attribute(Description, ATTRIBUTE-VALUES, sequence (the sc-attribute-value of Button));
        Description = change-attribute(Description, LABEL, "[the sc-attribute-value of Button]"); 
        Description = change-attribute(Description, OR-FILTER, true);
        Color = call GET-BACKGROUND-COLOR-FOR-PRIORITY(the sc-attribute-value of Button);
        Description = change-attribute(Description, BACKGROUND-COLOR, Color); end;
    if Button is an sc-category-filter then begin
        Description = change-attribute (Description, ATTRIBUTE-NAMES, sequence (the sc-attribute-name of Button));
        Description = change-attribute (Description, ATTRIBUTE-VALUES, sequence (the sc-attribute-value of Button));
        Description = change-attribute (Description, LABEL, "[the sc-attribute-name of Button] = [the sc-attribute-value of Button]"); end
    else if Button is an sc-attribute-filter then begin 
        Description = change-attribute(Description, ATTRIBUTE-NAMES, sequence (the sc-attribute-name of Button));
        if the sc-attribute-value of Button does not exist then conclude that 
            the sc-attribute-value of Button = the symbol not-set;
        Description = change-attribute(Description, ATTRIBUTE-VALUES, sequence (the sc-attribute-value of Button));
        Description = change-attribute(Description, LABEL, "[the sc-attribute-name of Button] = [the sc-attribute-value of Button]"); 
        Description = change-attribute(Description, OR-FILTER, true); end;
 end else begin
    Description = structure(CLASS-NAME: the class of Button, {ICON-DESCRIPTION: the icon-description of Definition,}REPRESENTATION : the symbol TOOLBAR-BUTTON, GFR-TEXT-RESOURCE-GROUP: the gxl-help-resource of Button, RESOURCE-KEY: the gxl-help-text of Button);
     if Button is an gqsv-toggle-button then 
        Description = change-attribute(Description, STATE, (the gqsv-toggle-state of Button = the symbol ON ));
    end;
return Description;
end

create-column-description(Header: class gqsv-column-header-specification, Controller: class gxl-column-controller, SampleCell : class gxl-cell-group) = (structure)
Description: structure;
begin 
  Description = structure(LABEL: the gxl-cell-group-initialization-data of Header, KEY: the gqsv-attribute-or-key of Header, TYPE: the gxl-cell-type of SampleCell, SELECTABLE: the gxl-cells-are-selectable of Header, EDITABLE: the gxl-cells-are-editable of Header, KEY-CONVERTER: the gqsv-key-value-conversion-procedure of Header, COLOR-FORMATTER : the gqsv-dynamic-color-formatter of Header, HEADER-FONT-SIZE : the gxl-font-size of Header, HEADER-FONT-SCALE: the gxl-font-scale of Header, HEADER-TEXT-ALIGNMENT: the gxl-text-alignment of Header, HEADER-BACKGROUND-COLOR : the gxl-default-background-color of Header, HEADER-TEXT-COLOR: the gxl-default-text-color of Header, HEADER-BORDER-COLOR: the gxl-default-border-color of Header, FONT-SIZE: the gxl-font-size of SampleCell, DEFAULT-BACKGROUND-COLOR: the gxl-default-background-color of SampleCell, DEFAULT-TEXT-COLOR: the gxl-default-text-color of SampleCell, DEFAULT-BORDER-COLOR: the gxl-default-border-color of SampleCell, FONT-SCALE: the gxl-font-scale of SampleCell, TEXT-ALIGNMENT: the gxl-text-alignment of SampleCell, WIDTH: the gxl-cell-width of Controller); 
  return Description;
end

get-tabular-view-configuration(TemplateName : symbol)
= (structure)
RowControllers, ColumnControllers, CellGroups : class item-list;
RootSpec: class gxl-root-specification ;
SubWS, WS: class kb-workspace;
Config: structure;
i : integer = 0;
Columns : sequence = sequence();
ColumnDescription : structure;
Buttons : sequence = sequence();
ButtonItems: sequence = sequence();
Toolbars : sequence = sequence();
ButtonDescription, ToolbarDescription: structure;
PrevItmOrEnd: item-or-value;
Itm: class item;
Header : class gqsv-column-header-specification;
Template: class gqsv-tabular-view-template;
Servers: sequence = sequence();
begin
 if not (there exists a gqsv-tabular-view-template Template  named by TemplateName) then signal the symbol error, "No Template Named [TemplateName]";
 if not (the subworkspace SubWS of Template exists and there exists a gxl-root-specification RootSpec upon SubWS) then signal the symbol error, "Template has not been configured";
  WS = call _gqsv-get-view-workspace (Template, gfr-default-window); 
  RowControllers, ColumnControllers, CellGroups =
    call gxl-collect-specification(RootSpec, gfr-default-window);
   for Header = each gqsv-column-header-specification in CellGroups do 
       ColumnDescription = call create-column-description(Header, ColumnControllers[i], CellGroups[2*i + 1]);
       Columns = insert-at-end(Columns, ColumnDescription);
       i=i+1;
    end;
    for Itm = each gxl-control-button upon WS do
       PrevItmOrEnd = call find-next-item(the item-x-position of Itm, ButtonItems);   
       if PrevItmOrEnd is a symbol then {END}
           ButtonItems = insert-at-end(ButtonItems, Itm)
       else 
           ButtonItems = insert-before(ButtonItems, Itm, PrevItmOrEnd);
    end;
    for Itm = each gxl-control-button in ButtonItems do 
         ButtonDescription = call create-button-description(Itm);
         Buttons = insert-at-end(Buttons, ButtonDescription); 
    end;
    for Itm = each gxl-toolbar upon WS do
         ToolbarDescription = call create-toolbar-description(Itm, Buttons);
         Toolbars = insert-at-end(Toolbars, Itm); 
    end; 
   { Buttons = sequence();}
    ButtonItems = sequence();
    for Itm = each sc-toggle-button upon WS do 
       PrevItmOrEnd = call find-next-item(the item-x-position of Itm, ButtonItems);   
       if PrevItmOrEnd is a symbol then {END}
           ButtonItems = insert-at-end(ButtonItems, Itm)
       else 
           ButtonItems = insert-before(ButtonItems, Itm, PrevItmOrEnd);
    end; 
    for Itm = each sc-toggle-button in ButtonItems do 
         ButtonDescription = call create-button-description(Itm);
         Buttons = insert-at-end(Buttons, ButtonDescription); 
         if Itm is an sc-subscriber then 
             Servers = insert-at-end(Servers, structure(NAME: the sc-publisher of Itm, INITIAL-STATE: the sc-active of Itm)); 
    end; 
   Config = structure (COLUMNS: columns, BUTTONS: Buttons, TOOLBARS: Toolbars, SERVERS: Servers);
   {  inform the operator that "CONFIG: [Config]";}

   return Config;
end
